import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for content to load and take screenshot
    await page.waitForSelector('.products-grid, .category-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Verify navigation by checking for electronics content
    const electronicsContent = await page.$eval('body', (body) => {
      const electronicsElements = body.querySelectorAll('*');
      let hasElectronics = false;
      let productCount = 0;

      electronicsElements.forEach(el => {
        const text = el.textContent?.toLowerCase() || '';
        if (text.includes('electronics') || text.includes('electronic')) {
          hasElectronics = true;
        }
        if (el.classList.contains('product-card')) {
          productCount++;
        }
      });

      return { hasElectronics, productCount };
    });

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        hasElectronicsContent: electronicsContent.hasElectronics,
        productCount: electronicsContent.productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
